        type=''plain''>Florencia Peña VIDEO PORNO, VIDEO PROHIBIDO, tvvip1.blogspot.com.ar
        reconoció este jueves la existencia de un video suyo y consideró "horrible
        no poder tener una vida íntima", luego de que en un programa de televisión
        anunciaran que les querían vender el material. Flor Peña, quien este año estuvo
        participando en el concurso "Bailando por un sueño" del programa que conduce
        Marcelo Tinelli, indicó que la existencia del video es real. Ver Video Aqui
        Link Video HD "Es horrible no poder tener una vida íntima. Es algo que se
        filmó en mi casa, con mi pareja y no tiene por qué salir a la luz y ya estoy
        averiguando quién lucró con él", afirmó la actriz en declaraciones al programa
        "Intrusos". De hecho, en el mismo envío televisivo se dio a conocer la noticia
        de la existencia del video, el cual lo habían ofrecido a cambio de dinero.
        "No entiendo cuál es el morbo de verme a mí teniendo relaciones con mi marido.
        ¿Dónde está el límite? Es la primera vez que me pasa y no sé de dónde salió
        ni con qué fin. Repito, es en la intimidad de mi casa, con mi marido, en mi
        cuarto y la ley me protege también", remarcó. La reconocida comediante indicó
        que sabe que lo que ahora le sucede a ella "le puede pasar a cualquiera",
        y agregó: "Que yo tenga una actividad pública no significa que toda mi vida
        lo sea". Si bien no se conocieron detalles del contenido del video, Peña le
        pidió a los periodistas del programa que no acepten la oferta de compra de
        las imágenes, ya que pertenecen a su intimidad.</media:description><media:keywords/><media:license
